<!DOCTYPE html>
<html>
<head>
<meta charset="UTF-8">
<title>bootcdn</title>
<!-- jQuery -->
<script src="https://cdn.bootcss.com/jquery/1.11.3/jquery.min.js"></script>
<script src="http://libs.baidu.com/jquery/1.11.1/jquery.min.js"></script>
<script src="https://cdn.jsdelivr.net/npm/jquery@1.12.4/dist/jquery.min.js"></script>

<!-- lodash: 具有一致接口、模块化、高性能等特性的 JavaScript 工具库 -->
<script src="https://cdn.bootcss.com/lodash.js/4.17.5/lodash.min.js"></script>

<!-- Bootstrap -->
<link href="https://cdn.bootcss.com/bootstrap/3.3.7/css/bootstrap.min.css" rel="stylesheet">
<link href="https://cdn.bootcss.com/bootstrap/3.3.7/css/bootstrap-theme.min.css" rel="stylesheet">
<script src="https://cdn.bootcss.com/bootstrap/3.3.7/js/bootstrap.min.js"></script>
<script src="https://cdn.bootcss.com/bootstrap/3.3.7/js/npm.js"></script>

<!-- require.js -->
<script src="https://cdn.bootcss.com/require.js/2.3.5/require.min.js"></script>

<!-- Font Awesome: 为您提供可缩放矢量图标,它可以被定制大小、颜色、阴影以及任何可以用 CSS 的样式 -->
<link href="https://cdn.bootcss.com/font-awesome/4.7.0/css/font-awesome.min.css" rel="stylesheet">

<!-- Normalize.css: 使不同的浏览器表现更一致 -->
<link href="https://cdn.bootcss.com/normalize/7.0.0/normalize.min.css" rel="stylesheet">

<!-- html5shiv: 针对 IE 浏览器的 HTML5 JavaScript 补丁，目的是让 IE 识别并支持 HTML5 元素 -->
<!--[if lt IE 9]>
	<script src="https://cdn.bootcss.com/html5shiv/r29/html5.min.js"></script>
<![endif]-->

<!-- element-ui: 为开发者、设计师和产品经理准备的基于 Vue 2.0 的桌面端组件库 -->
<link rel="stylesheet" href="https://unpkg.com/element-ui/lib/theme-chalk/index.css">
<script src="https://unpkg.com/element-ui/lib/index.js"></script>

<!-- tippy.js:  -->
<script src="https://unpkg.com/tippy.js@3/dist/tippy.all.min.js"></script>

<!-- moment: JavaScript 日期处理类库，用于解析、检验、操作、以及显示日期 -->
<script src="https://cdn.bootcss.com/moment.js/2.20.1/moment.min.js"></script>
<script src="https://cdn.bootcss.com/moment.js/2.20.1/moment-with-locales.min.js"></script>
<script src="https://cdn.bootcss.com/moment.js/2.20.1/locale/zh-cn.js"></script>

<!-- Sortable -->
<script src="https://cdn.bootcss.com/Sortable/1.6.0/Sortable.min.js"></script>

<!-- localforage -->
<script src="https://cdn.bootcss.com/localforage/1.7.1/localforage.min.js"></script>

</head>
<body>

</body>
</html>
